import React from "react";
import {getAllServices,codes} from '../data/services';
import { Link } from "react-router-dom";

export const ServicesList=()=>{
  
    return (<div>{getAllServices.map(s=><Link to={`/ServicesList/${codes[s]}`}>{s.name}</Link>)}</div>)
}
